{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/melmok/bellabeat-case-study-with-r?scriptVersionId=150620533\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"dff8c8fc","metadata":{"papermill":{"duration":0.020058,"end_time":"2023-11-14T05:01:36.585948","exception":false,"start_time":"2023-11-14T05:01:36.56589","status":"completed"},"tags":[]},"source":["# Bellabeat Case Study with R\n","  "]},{"cell_type":"markdown","id":"ae6e2122","metadata":{"papermill":{"duration":0.0136,"end_time":"2023-11-14T05:01:36.615288","exception":false,"start_time":"2023-11-14T05:01:36.601688","status":"completed"},"tags":[]},"source":["## **ASK**\n","\n","  #### Business Task \n","Asked to analyze smart device usage data in order to fain insight from how consumers use non-Bellabeat devices to understand growth opportunities, and high-level recommendations how these trends can inform the marketing strategy. \n","\n","\n","##### Business Objective\n","\n","What are some trends in smart device usage?\n","How could these trends apply to Bellabeat customers?\n","How could these trends help influence Bellabeat marketing strategy\n","\n","\n","## **PREPARE**\n","\n","   #### Data Source\n","Public data from FitBit fitness trackers, including data on daily activity, steps, heart beat and sleep monitoring had been provided. \n","\n","\n","   #### Data Integrity\n","The dataset had a few concerns while working on it and noted that it may be not be ideal for our analysis. \n","\n","*   The data's sample size has an average of 30 users which could lead to potential bias in findings. \n","\n","*   The period recorded only has a month's data, which may not accurately reflect long-term trends.\n","\n","*   The data includes users of different genders and would not be able to draw meaningful conclusions due to bias as Bellabeat focuses on women's health. \n","\n","*   There's an obvious lack of demographic information, like gender and age.\n","\n","The data has limited data for the analysis which needed to be much mindful during the analysis. \n","\n","## **PROCESS**\n","\n","Will be using R as the tools for the analysis\n","  "]},{"cell_type":"code","execution_count":1,"id":"a2adfcce","metadata":{"execution":{"iopub.execute_input":"2023-11-14T05:01:36.648084Z","iopub.status.busy":"2023-11-14T05:01:36.645169Z","iopub.status.idle":"2023-11-14T05:01:37.967292Z","shell.execute_reply":"2023-11-14T05:01:37.965373Z"},"papermill":{"duration":1.340951,"end_time":"2023-11-14T05:01:37.969846","exception":false,"start_time":"2023-11-14T05:01:36.628895","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\u001b[23m) to force all conflicts to become errors\n",