 the cilent could introducing daily KPIs/activity and reminders to their customers on daily basis to remind them to get on their feets.\n","\n","**How could these trends help influence Bellabeat marketing strategy?**\n","\n","It could refocus on slower / lighter activities rather than very active activity during the marketing strategy\n","\n","**Disclaimer:**\n","\n","Data is only based on a small group of participants and may be bias.\n","\n","There is also no age / gender group shown as well which means the data may not be reliable"]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":1752235,"sourceType":"datasetVersion"}],"dockerImageVersionId":30530,"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":10.559754,"end_time":"2023-11-14T05:01:43.617904","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-11-14T05:01:33.05815","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}